-- ----------------------------
-- Table structure for wdb_goods
-- ----------------------------
DROP TABLE IF EXISTS `wdb_goods`;
CREATE TABLE `wdb_goods`  (
  `id` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '主键',
  `reguser_id` int(11) NOT NULL COMMENT '注册用户id',
  `song_huo_ru_hu` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '送货入户模版id',
  `shang_men_an_zhuang` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '上门安装模版id',
  `song_huo_an_zhuang` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '送货入户并安装模版id',
  `mai_jia_zi_ti` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '买家自提模版id',
  `tiny_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '短标题',
  `invoice_status` int(1) NULL DEFAULT NULL COMMENT '是否支持正品发票；0-不支持、1-支持',
  `zhi_huan_bu_xiu` int(3) NULL DEFAULT NULL COMMENT '只换不修的天数，目前只支持0和365',
  `quan_guo_lian_bao` int(1) NULL DEFAULT NULL COMMENT '0：不支持全国联保；1：支持全国联保',
  `status` int(1) NULL DEFAULT NULL COMMENT '商品状态 1:上架，2：下架，3：售罄 4：已删除',
  `goods_id` bigint(30) NOT NULL COMMENT '商品id',
  `buy_limit` bigint(30) NULL DEFAULT NULL COMMENT '限购次数',
  `carousel_gallery_list` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '商品轮播图列表',
  `cat_id` bigint(30) NULL DEFAULT NULL COMMENT '叶子类目ID',
  `cost_template_id` bigint(30) NULL DEFAULT NULL COMMENT '运费模版id',
  `country_id` int(11) NULL DEFAULT NULL COMMENT '国家id',
  `customer_num` bigint(30) NULL DEFAULT NULL COMMENT '团购人数',
  `goods_type` int(11) NULL DEFAULT NULL COMMENT '商品类型：1-国内普通商品，2-进口，3-国外海淘，4-直邮 ,5-流量,6-话费,7,优惠券;8-QQ充值,9-加油卡,18-CC行邮 暂时支持1-普通商品的上架',
  `goods_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品名称',
  `goods_desc` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '商品描述',
  `warehouse` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '保税仓',
  `is_customs` int(1) NULL DEFAULT NULL COMMENT '是否需要上报海关 0:否 1:是',
  `customs` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '海关名称',
  `market_price` bigint(30) NULL DEFAULT NULL COMMENT '市场价格，单位为分',
  `is_pre_sale` int(1) NULL DEFAULT NULL COMMENT '是否预售,1-预售商品，0-非预售商品',
  `pre_sale_time` bigint(30) NULL DEFAULT NULL COMMENT '预售时间',
  `shipment_limit_second` bigint(30) NULL DEFAULT NULL COMMENT ' 承诺发货时间（ 秒）',
  `order_limit` bigint(30) NULL DEFAULT NULL COMMENT '单次限量',
  `is_refundable` int(1) NULL DEFAULT NULL COMMENT '是否7天无理由退换货，1-支持，0-不支持',
  `is_folt` int(1) NULL DEFAULT NULL COMMENT '是否支持假一赔十，0-不支持，1-支持',
  `warm_tips` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '水果类目温馨提示',
  `image_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品主图',
  `detail_gallery_list` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '商品详情图',
  `outer_goods_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商家编码（商品维度）同其他接口中的outer_goods_id 、out_goods_id、out_goods_sn、outer_goods_sn 都为商家编码（goods维度）。',
  `second_hand` int(1) NULL DEFAULT NULL COMMENT '是否二手 1:是 0:否',
  `lack_of_weight_claim` int(11) NULL DEFAULT NULL COMMENT '缺重包退',
  `bad_fruit_claim` int(11) NULL DEFAULT NULL COMMENT '坏果包赔',
  `goods_property_list` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '商品属性列表',
  `sku_list` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT 'sku列表',
  `oversea_goods` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT 'oversea_goods',
  `carousel_video` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '商品视频',
  `add_time` datetime(0) NULL DEFAULT NULL COMMENT '同步时间',
  `update_time` datetime(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '数据变动时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `un_goods_id`(`goods_id`) USING BTREE COMMENT 'goodsId唯一'
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of wdb_goods
-- ----------------------------

-- ----------------------------
-- Table structure for wdb_goods_batch
-- ----------------------------
DROP TABLE IF EXISTS `wdb_goods_batch`;
CREATE TABLE `wdb_goods_batch`  (
  `id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `batch_type` int(2) NOT NULL COMMENT '操作类型',
  `batch_desc` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '具体操作BASE64指令',
  `add_time` datetime(0) NOT NULL COMMENT '写入时间',
  `reguser_id` int(11) NOT NULL COMMENT '注册用户id',
  `batch_status` int(1) NOT NULL COMMENT '0待处理 1处理中 2处理完成',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of wdb_goods_batch
-- ----------------------------

-- ----------------------------
-- Table structure for wdb_goods_batch_detail
-- ----------------------------
DROP TABLE IF EXISTS `wdb_goods_batch_detail`;
CREATE TABLE `wdb_goods_batch_detail`  (
  `id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `goods_id` bigint(30) NOT NULL COMMENT '商品id',
  `reguser_id` int(11) NOT NULL COMMENT '注册用户id',
  `batch_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '批处理id',
  `old_value` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '原始值',
  `new_value` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '新值',
  `add_time` datetime(0) NULL DEFAULT NULL COMMENT '处理时间',
  `state` int(1) NULL DEFAULT NULL COMMENT '0处理中 1成功 2失败',
  `err_msg` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '处理PDD返回错误信息',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '完成时间',
  `batch_type` int(2) NULL DEFAULT NULL COMMENT '处理类型',
  `batch_channel` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '处理方式',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of wdb_goods_batch_detail
-- ----------------------------

-- ----------------------------
-- Table structure for wdb_goods_cats
-- ----------------------------
DROP TABLE IF EXISTS `wdb_goods_cats`;
CREATE TABLE `wdb_goods_cats`  (
  `id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `cat_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `cat_id` bigint(30) NULL DEFAULT NULL,
  `parent_cat_id` bigint(30) NULL DEFAULT NULL,
  `level` int(11) NULL DEFAULT NULL,
  `add_time` datetime(0) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `bt_cat_id`(`cat_id`) USING BTREE COMMENT '加速查询B树'
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商品类目表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of wdb_goods_cats
-- ----------------------------

-- ----------------------------
-- Table structure for wdb_goods_logistics_template
-- ----------------------------
DROP TABLE IF EXISTS `wdb_goods_logistics_template`;
CREATE TABLE `wdb_goods_logistics_template`  (
  `id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `reguser_id` int(11) NOT NULL COMMENT '注册用户id',
  `template_id` bigint(30) NOT NULL COMMENT '运费模板id',
  `template_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '运费模板名称',
  `add_time` datetime(0) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of wdb_goods_logistics_template
-- ----------------------------

-- ----------------------------
-- Table structure for wdb_goods_sync
-- ----------------------------
DROP TABLE IF EXISTS `wdb_goods_sync`;
CREATE TABLE `wdb_goods_sync`  (
  `id` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `reguser_id` int(11) NOT NULL,
  `status` int(2) NOT NULL COMMENT '0默认正在同步 1同步完成 2同步失败',
  `create_date` datetime(0) NULL DEFAULT NULL,
  `modify_date` datetime(0) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '同步商品记录表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of wdb_goods_sync
-- ----------------------------
